import React from 'react';
import { Link } from 'react-router-dom';
import { BASE_URL } from '../utils/config';
import galleryImages from './../Gallery/images'; // Assuming you have the galleryImages array

const genres = ['Action', 'Adventure', 'Comedy', 'Drama'];

const Gallery = () => {
    return (
        <div className="container">
            <div className="row">
                {genres.map((genre, index) => (
                    <div className="col-md-3 mb-3" key={index}>
                        <Link to={`${BASE_URL}/gallery/${genre}`} className="card position-relative">
                            <img src={galleryImages[index]} alt={genre} className="card-img-top" />
                            <div className="card-title-overlay position-absolute top-50 start-50 translate-middle">
                                <h5 className="card-title text-center">{genre}</h5>
                            </div>
                        </Link>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Gallery;
